import './game.scss';
import React from 'react';
import Scores from './scores/scores';
import Canvas from './canvas/canvas';
import Chat from './chat/chat'

function Game({username,roomname,socket}){
    return(
    <div className='Game'>
        <div className='left'>
            <Scores
                roomname={roomname}
                socket={socket}
            />
        </div> 
        <div>
            <Canvas
                userName={username}
                socket={socket}
                drawer={"d"}
            />
        </div>
        <div className='right'>
            <Chat
                username={username} 
                roomname={roomname} 
                socket={socket}
            /> 
        </div>
    </div>);
}

export default Game;
